INSERT INTO `ALERT` VALUES (1,1,'Retard de payment','<p><strong><em>$TODAY_DATE$  <br /><span style=\"text-decoration: underline;\">Message prvenant de:</span></em> $SCHOOL_NAME$, $SCHOOL_WEBSITE$<br /><em><span style=\"text-decoration: underline;\">Object:</span></em> $SUBJECT_NAME$</strong></p>\n<p>Bonjour Cher $STUDENT_NAME$,</p>\n<p>Un payment de <span style=\"text-decoration: underline;\"><strong>$DUE_TUITION$</strong></span> est du le <strong>$DUE_DATE$</strong> sur le montant total de <strong>$TOTAL_TUITION$</strong>.    <br />Montant paye a ce jour: <strong>$PAYED_TUITION$</strong>.</p>\n<p>Merci de passer a la caisse pour effectuer le payment.</p>\n<p>La Direction</p>',4,0,1,5,1,'2012-02-06 02:33:07','2012-02-06 02:33:07',NULL,1,NULL,0,5,'2012-02-06 02:33:07','2012-02-06 02:33:07',1,'1'),(2,1,'Qantite minimale atteinte','<p><strong>$TODAY_DATE$<br /><span style=\"text-decoration: underline;\"><em>Message provenant de</em>:</span> $SCHOOL_NAME$, $SCHOOL_WEBSITE$</strong><strong><span style=\"text-decoration: underline;\"><br /><em>Object</em>:</span> $SUBJECT_NAME$</strong><br /><br /> La quantite minimale de $PRODUCT_NAME$ est atteinte.   La quantite actuelle en stock est $QUANTITY_IN_STOCK$.</p>\n<p>Merci</p>',4,0,1,5,1,'2012-02-06 02:33:07','2012-02-06 02:33:07',NULL,1,NULL,0,5,'2012-02-06 02:33:07','2012-02-06 02:33:07',1,'2'),(3,1,'Retard de retour','<p><strong>$TODAY_DATE$<br /><em><span style=\"text-decoration: underline;\">Message provenant de</span></em><span style=\"text-decoration: underline;\">:</span> $SCHOOL_NAME$</strong><strong>, $SCHOOL_WEBSITE$.<br /><span style=\"text-decoration: underline;\"><em>Object</em>:</span> $SUBJECT_NAME$</strong></p>\n<p>Le delai retour <strong>($DUE_DATE$</strong>) de l\'emprunt ci-dessous a expire.</p>\n<p>Nom du produit: $PRODUCT_NAME$.  <br />Date de la demande: $REQUESTED_DATE$  <br />Date de reception: $PICKED_UP_DATE$ <br /> Quantite a retourne: $QUANTITY_TO_BE_RETURNED$ <br /> Quantite retourne: $QUANTITY_RETURNED$</p>\n<p>Veuillez retourner ce livre dans de brefs delais, faute de quoi,<br />les sanctions en vigueur seront appliquees.</p>\n<p>Merci.</p>\n<p>La bibliothequaire.</p>',4,0,1,5,1,'2012-02-06 02:33:07','2012-02-06 02:33:07',NULL,1,NULL,0,5,'2012-02-06 02:33:07','2012-02-06 02:33:07',1,'3');
