ttachment: initial; background-origin: initial; background-clip: initial; background-color: white; background-position: initial initial; background-repeat: initial initial;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #f7f7f7; background-position: initial initial; background-repeat: initial initial;\" lang=\"FR\">Chers parents,<br /> </span><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\" lang=\"FR\">Nous voudrions, en cette fin de semaine, vous donner certaines informations pratiques.<br /> -</span><span style=\"font-size: 10pt; font-family: \'Times New Roman\', serif;\" lang=\"FR\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\" lang=\"FR\">La composition du 1<sup>er</sup>&nbsp;trimestre 2011-2012 aura lieu du 13 au 15 d&eacute;cembre 2011 du CP1 au CM2. Nous vous prions de r&eacute;viser toutes les le&ccedil;ons du trimestre avec les enfants.<br /> -</span><span style=\"font-size: 10pt; font-family: \'Times New Roman\', serif;\" lang=\"FR\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\" lang=\"FR\">Le samedi 17 d&eacute;cembre 2011, tous les enfants de la maternelle 1 au CM2 sont attendus &agrave; l&rsquo;&eacute;cole \"LA MADONE&nbsp;ANNEXE\" &agrave; partir de 15h pour f&ecirc;ter NOEL.<br /> Nous vous remercions de votre compr&eacute;hension et de votre collaboration permanente.<br /> </span><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Bon week-end chers parents&nbsp;!</span></p>\n</p>\n<p>&nbsp;</p>','\0JFIF\0\0\0d\0d\0\0\0Ducky\0\0\0\0\0<\0\0\0Adobe\0d\0\0\0\0\0		\n\n\n\n\r\r\Z\Z\0\0d\0d\0\0\0\0